import{Tabs,H2,Table} from 'govuk-react';
import { useNavigate } from 'react-router-dom';
import DoctorTab from './DoctorsAvailable/DoctorTab';
import BookTab from './BookAppointment/BookTab';
import ViewTab from './ViewAppointment/ViewTab';
import DRTab from './De-Register/DRTab';

function GPTabs(){
     
    const navigate = useNavigate();
return(
    <Tabs>
        <Tabs.Title>
            Contents
        </Tabs.Title>
  <Tabs.List>
    <Tabs.Tab onClick={() => navigate("/Doctors-available")} selected>
      Doctors at GP
    </Tabs.Tab>
    <Tabs.Tab onClick={() => navigate("/BookTab")}>
      Book Appointment
    </Tabs.Tab>
    <Tabs.Tab onClick={() => navigate("/ViewTab")}>
      View/Cancel Appointment
    </Tabs.Tab>
    <Tabs.Tab onClick={() => navigate("/DRTab")}>
      De-Register
    </Tabs.Tab>
  </Tabs.List>
 
  <DoctorTab />
  
  <BookTab />

  <ViewTab />

  <DRTab />

</Tabs>

)};

export default GPTabs;
